package logico;

public class Enfermedad {

	private String tipoenfermedad;
	private String nombenferme;
	private String codienferme;
 
	public Enfermedad() {
		// TODO Auto-generated constructor stub
	}

	public String getTipoenfermedad() {
		return tipoenfermedad;
	}

	public void setTipoenfermedad(String tipoenfermedad) {
		this.tipoenfermedad = tipoenfermedad;
	}

	public String getNombenferme() {
		return nombenferme;
	}

	public void setNombenferme(String nombenferme) {
		this.nombenferme = nombenferme;
	}

	public String getCodienferme() {
		return codienferme;
	}

	public void setCodienferme(String codienferme) {
		this.codienferme = codienferme;
	}
	

}
